            </li>
            <li>
              <NavLink to="events" lassName={(isActive) => (isActive ? classes.active : undefined)}>
                Events
              </NavLink>
            </li>
          </ul>
        </nav>
      </header>
      <Outlet />
    </>
  );
}

export default MainNavigation;
